import React, { Component } from 'react'
import SearchBar from './components/SearchBar'

export class App extends Component {

  state={
    search : ''
  }

  setSearch = (text) =>{
    this.setState({search : text})

    console.log(this.state.search)
  }

  render() {
    return (
      <div>
        <SearchBar search={this.setSearch}/>
      </div>
    )
  }
}

export default App
